ActionCuts funcționează căutând comentarii special formatate într-o comandă rapidă. Acesta înlocuiește comentariul cu conținutul complet de o altă comandă rapidă sau un bloc de acțiune de la ActionCuts acțiune blocuri biblioteca.

Fiecare comentariu conține o singură linie de text:

{{ActionCuts Shortcut:XYZ}}

Sau

{{ActionCuts Action:XYZ}}

în cazul în care XYZ este numele de comenzi rapide sau bloc de acțiune pentru a încorpora.

